import React from 'react';

import Alert from 'react-bootstrap/Alert';

const Alerts = ({ alertObj }) => {
  return (
    <Alert show={alertObj.show} variant={alertObj.type}>
      {alertObj.msg}
    </Alert>
  );
};

export default Alerts;
